q = '0123456789abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ!#$%&()*+,-./:;<=>?@[]^_`{|}~'

def zz(x):
    a = 0
    for i in x:
        a = a*len(q)+q.find(i)
    return a

k=[zz(x) for x in z.split('"')]

n, m = map(int, input().split())

print(k[n]%m)